import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import contact from './contacts'
import * as cal from './Heading'
import { Route, Link } from 'react-router-dom'

function createCard(contact) {
  if (contact.theloai == "giải đố" || contact.theloai == "thể thao")
  return (
    <Link to="./Xam">
    <cal.default 
    id = {contact.id}
    image = {contact.image}
    name = {contact.name}
    ngayph = {contact.ngayph}
    theloai = {contact.theloai}
    solike = {contact.solike}
    sodislike = {contact.sodislike}
    socmt = {contact.socmt}
     />
    </Link>
  )
}

function App() {
  const [items, setItems] = useState([]);
  return (
  <div className = "cacgame">
    {contact.map(createCard)}
  </div>
  )
 }

export default App;
